import React, { FC, useState } from "react";

interface Event {
  preventDefault: any;
  target: any;
  name?: string;
  value?: string;
}

const Signup: FC<any> = () => {
  const [state, setState] = useState({
    email: "",
    username: ""
  });

  function handleChange(e: any) {
    e.preventDefault();
    setState(prevState => {
      return { ...prevState, [e.target.name]: e.target.value };
    });
  }

  return (
    <div>
      <h1>Sign up</h1>
      <form onSubmit={() => {}}>
        <input
          type="text"
          name="email"
          placeholder="Email"
          onChange={e => handleChange(e)}
        />
        <input
          type="text"
          name="username"
          placeholder="Username"
          onChange={e => handleChange(e)}
        />
      </form>
    </div>
  );
};

export default Signup;
